5hdHVyZSI6IiJ9","edge_media_to_tagged_user":{"edges":[{"node":{"user":{"full_name":"IMPERIAL GARDEN","id":"1780363917","is_verified":false,"profile_pic_url":"https://instagram.ffru4-1.fna.fbcdn.net/v/t51.2885-19/s150x150/12106077_1637645699857405_1202234016_a.jpg?_nc_ht=instagram.ffru4-1.fna.fbcdn.net\u0026_nc_ohc=Zr0Dhlq6q4IAX-Ug01A\u0026oh=8dd9b5bf998d7868ba2171f10522c08d\u0026oe=5F634CAF","username":"imperial_garden"},"x":0.559111084,"y":0.427555542}}]},"edge_media_to_caption":{"edges":[{"node":{"text":"\u0421\u0415\u0417\u041e\u041d \u041f\u041e\u0421\u0410\u0414\u041e\u041a \u0422\u041e\u041b\u042c\u041a\u041e \u041d\u0410\u0427\u0418\u041d\u0410\u0415\u0422\u0421\u042f!!!\n.\n\u0414\u0430-\u0434\u0430, \u0432\u044b \u043d\u0435 \u043e\u0441\u043b\u044b\u0448\u0430\u043b\u0438\u0441\u044c, \u0438\u043c\u0435\u043d\u043d\u043e \u0442\u0430\u043a! \u0410 \u0432\u044b \u0447\u0442\u043e, \u0443\u0436\u0435 \u0441\u0432\u0435\u0440\u043d\u0443\u043b\u0438 \u0441\u0435\u0437\u043e\u043d \u0434\u043e \u0441\u043b\u0435\u0434\u0443\u044e\u0449\u0435\u0439 \u0432\u0435\u0441\u043d\u044b? \u041d\u0443 \u0438 \u0437\u0440\u044f! \u0412\u0435\u0434\u044c \u043a\u0440\u0443\u043f\u043d\u043e\u043c\u0435\u0440\u044b \u0441\u0430\u0436\u0430\u044e\u0442 \u0438\u043c\u0435\u043d\u043d\u043e \u0432 \u00ab\u0441\u043f\u044f\u0449\u0438\u0439\u00bb \u0441\u0435\u0437\u043e\u043d! \u0412\u0440\u0435\u043c\u044f \u043f\u043e\u043a\u0443\u043f\u0430\u0442\u044c \u043a\u0440\u0443\u043f\u043d\u044b\u0435 \u0434\u0435\u0440\u0435\u0432\u044c\u044f!\n.\n\u041d\u0430 \u0434\u043d\u044f\u0445  \u0431\u044b\u043b\u0430 \u0432 \u0441\u0430\u0434\u043e\u0432\u043e\u043c \u0446\u0435\u043d\u0442\u0440\u0435 Imperial Garden  @imperialgarden \u043d\u0430 \u041d\u043e\u0432\u043e\u0440\u0438\u0436\u0441\u043a\u043e\u043c \u0448\u043e\u0441\u0441\u0435 (\u0432\u0438\u0434\u0435\u043b\u0438 \u0441\u0442\u043e\u0440\u0438\u0437?) \u0438 \u043f\u043e\u043b\u0443\u0447\u0438\u043b\u0430 \u043c\u0430\u0441\u0441\u0443 \u0443\u0434\u043e\u0432\u043e\u043b\u044c\u0441\u0442\u0432\u0438\u044f \u043e\u0442 \u044d\u0442\u043e\u0439 \u043f\u0440\u043e\u0433\u0443\u043b\u043a\u0438, \u043f\u043e\u0442\u043e\u043c\u0443 \u0447\u0442\u043e \u044d\u0442\u043e \u0431\u044b\u043b\u0430 \u0438\u043c\u0435\u043d\u043d\u043e \u043f\u0440\u043e\u0433\u0443\u043b\u043a\u0430, \u0440\u0430\u0431\u043e\u0442\u043e\u0439 \u043d\u0430\u0437\u0432\u0430\u0442\u044c \u0434\u0430\u0436\u0435 \u044f\u0437\u044b\u043a \u043d\u0435 \u043f\u043e\u0432\u043e\u0440\u0430\u0447\u0438\u0432\u0430\u0435\u0442\u0441\u044f.\n.\n\u041f\u0440\u0438\u0437\u043d\u0430\u044e\u0441\u044c \u0447\u0435\u0441\u0442\u043d\u043e, \u0442\u0430\u043a\u043e\u0433\u043e \u0440\u0430\u0437\u043d\u043e\u043e\u0431\u0440\u0430\u0437\u0438\u044f \u0440\u0430\u0441\u0442\u0435\u043d\u0438\u0439, \u043a\u0430\u043a \u0432 Imperial Garden, \u0431\u043e\u043b\u044c\u0448\u0435 \u043d\u0435\u0442 \u043d\u0438\u0433\u0434\u0435. \u041b\u0438\u043f\u044b \u0438 \u0431\u0435\u0440\u0451\u0437\u044b, \u043a\u043b\u0435\u043d\u044b \u0438 \u0434\u0443\u0431\u044b, \u0441\u043e\u0441\u043d\u044b \u0438 \u0442\u0443\u0438, \u043f\u043b\u043e\u0434\u043e\u0432\u044b\u0435 \u0438 \u0431\u043e\u043d\u0441\u0430\u0438 - \u0435\u0441\u0442\u044c \u0432\u044b\u0431\u043e\u0440 \u0434\u043b\u044f \u0441\u0430\u043c\u043e\u0433\u043e \u043a\u0430\u043f\u0440\u0438\u0437\u043d\u043e\u0433\u043e \u043f\u043e\u043a\u0443\u043f\u0430\u0442\u0435\u043b\u044f. \u0418 \u0438\u043c\u0435\u043d\u043d\u043e \u0441\u0435\u0439\u0447\u0430\u0441 \u0442\u043e\u0442 \u043c\u043e\u043c\u0435\u043d\u0442, \u043a\u043e\u0433\u0434\u0430 \u043c\u043e\u0436\u043d\u043e \u043f\u0440\u0438\u0435\u0445\u0430\u0442\u044c \u0438 \u043d\u0435\u0441\u043f\u0435\u0448\u043d\u043e \u043f\u0440\u043e\u0433\u0443\u043b\u044f\u0442\u044c\u0441\u044f \u043f\u043e \u0441\u0430\u0434\u043e\u0432\u043e\u043c\u0443 \u0446\u0435\u043d\u0442\u0440\u0443, \u043f\u043e\u0434\u043e\u0431\u0440\u0430\u0442\u044c \u0441\u0435\u0431\u0435 \u0440\u0430\u0441\u0442\u0435\u043d\u0438\u044f \u043f\u043e \u0432\u043a\u0443\u0441\u0443, \u043f\u043e\u043a\u0430 \u0435\u0449\u0451 \u0441 \u043d\u0438\u0445 \u043d\u0435 \u043e\u0431\u043b\u0435\u0442\u0435\u043b\u0430 \u043b\u0438\u0441\u0442\u0432\u0430, \u0432\u044b\u0431\u0440\u0430\u0442\u044c, \u043a\u0443\u043f\u0438\u0442\u044c \u0438 \u0437\u0430\u043f\u043b\u0430\u043d\u0438\u0440\u043e\u0432\u0430\u0442\u044c \u043f\u0440\u043e\u0444\u0435\u0441\u0441\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u0443\u044e \u043f\u043e\u0441\u0430\u0434\u043a\u0443 \u043a\u0440\u0443\u043f\u043d\u043e\u043c\u0435\u0440\u043e\u0432 \u0432 \u043e\u0441\u0435\u043d\u043d\u0435-\u0437\u0438\u043c\u043d\u0438\u0439 \u043f\u0435\u0440\u0438\u043e\u0434, \u0434\u0430 \u043d\u0430\u043a\u043e\u043d\u0435\u0446 \u043f\u0440\u043e\u0441\u0442\u043e \u043f\u043e\u0447\u0435\u0440\u043f\u043d\u0443\u0442\u044c \u0438\u0434\u0435\u0438 \u0434\u043b\u044f \u0441\u0430\u0434\u0430.\n.\n\u041a\u0441\u0442\u0430\u0442\u0438, \u043f\u0440\u0438\u0435\u0437\u0436\u0430\u0439\u0442\u0435 \u0441 \u0434\u0435\u0442\u044c\u043c\u0438, \u0438\u043c \u0431\u0443\u0434\u0435\u0442 \u0438\u043d\u0442\u0435\u0440\u0435\u0441\u043d\u043e \u043f\u043e\u0438\u0433\u0440\u0430\u0442\u044c \u043d\u0430 \u043f\u043b\u043e\u0449\u0430\u0434\u043a\u0435 \u0438\u043b\u0438 \u0441\u0445\u043e\u0434\u0438\u0442\u044c \u0432 \u0437\u043e\u043e\u043f\u0430\u0440\u043a \u0441 \u043f\u0430\u0432\u043b\u0438\u043d\u0430\u043c\u0438 \u0438 \u0430\u043b\u044c\u043f\u0430\u043a\u0438, \u0430 \u0435\u0449\u0451 \u043c\u043e\u0436\u043d\u043e \u043f\u043e\u043b\u0430\u043a\u043e\u043c\u0438\u0442\u044c\u0441\u044f \u0448\u043e\u043a\u043e\u043b\u0430\u0434\u043e\u043c. \u0410 \u0432\u044b \u043c\u043e\u0436\u0435\u0442\u0435 \u0432 \u044d\u0442\u043e \u0432\u0440\u0435\u043c\u044f \u0432\u044b\u043f\u0438\u0442\u044c \u0447\u0430\u0448\u0435\u0447\u04         <script type="text/javascript">
(function(){
  function normalizeError(err) {
    var errorInfo = err.error || {};
    var getConfigProp = function(propName, defaultValueIfNotTruthy) {
      var propValue = window._sharedData && window._sharedData[propName];
      return propValue ? propValue : defaultValueIfNotTruthy;
    };
    return {
      line: err.line || errorInfo.message || 0,
      column: err.column || 0,
      name: 'InitError',
      message: err.message || errorInfo.message || '',
      script: errorInfo.script || '',
      stack: errorInfo.stackTrace || errorInfo.stack || '',
      timestamp: Date.now(),
      ref: window.location.href,
      deployment_stage: getConfigProp('deployment_stage', ''),
      frontend_env: getConfigProp('frontend_env', 'prod'),
      rollout_hash: getConfigProp('rollout_hash', ''),
      is_prerelease: window.__PRERELEASE__ || false,
      bundle_variant: getConfigProp('bundle_variant', null),
      request_url: err.url || window.location.href,
      response_status_code: errorInfo.statusCode || 0
    }
  }
  window.addEventListener('load', function(){
    if (window.__bufferedErrors && window.__bufferedErrors.length) {
      if (window.caches && window.caches.keys && window.caches.delete) {
        window.caches.keys().then(function(keys) {
          keys.forEach(function(key) {
            window.caches.delete(key)
          })
        })
      }
      window.__bufferedErrors.map(function(error) {
        return normalizeError(error)
      }).forEach(function(normalizedError) {
        var request = new XMLHttpRequest();
        request.open('POST', '/client_error/', true);
        request.setRequestHeader('Content-Type', 'application/json; charset=utf-8');
        request.send(JSON.stringify(normalizedError));
      })
    }
  })
}());
</script>
    </body>
</html>
